import React, { Component } from 'react';

class Table extends Component {
  render() {
    return (
        <tr>
          <td>
            {this.props.obj.nom}
          </td>
          <td>
            {this.props.obj.prenon}
          </td>
        </tr>
    );
  }
}

export default Table;
